CREATE DEFINER=`nhc`@`%` PROCEDURE `animal_define_menu_hash`(IN `p_animal` INT UNSIGNED)
BEGIN
	DECLARE l_menuHash varchar(256) DEFAULT '';
    DECLARE l_foodId INT UNSIGNED;
    DECLARE l_eoc BOOL DEFAULT FALSE;
	DECLARE csr_menu CURSOR FOR
    SELECT food
    FROM menu
    WHERE animal = p_animal
    ORDER BY food;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET l_eoc = true;
    
    OPEN csr_menu;
    FETCH csr_menu INTO l_foodId;
    WHILE NOT l_eoc DO
		SET l_menuHash = CONCAT(l_menuHash, CAST(l_foodId AS CHAR), ':');
        FETCH csr_menu INTO l_foodId;
    END WHILE;
    CLOSE csr_menu;
    
    UPDATE animal
    SET menu_hash = l_menuHash
    WHERE id = p_animal;
END$$

CREATE DEFINER=`nhc`@`%` PROCEDURE `cage_set_done`(`cage` INT)
BEGIN
	update cage
    set current_action = null
    where id = cage;
END$$

CREATE DEFINER=`nhc`@`%` PROCEDURE `initiate_action`(`p_action_id` INT, `p_history_id` INT, `p_execution_date` DATE)
BEGIN
	declare l_route_id int;
    
    select route
		into l_route_id
        from `action`
        where id = p_action_id;
    
    set SQL_SAFE_UPDATES = 0;
	update cage
    set current_action = p_history_id
    where route = l_route_id and
		(select max(staff_only)
         from hospitalization
         where hospitalization.cage = cage.id) = 0;
	set SQL_SAFE_UPDATES = 1;
         
	update `action`
    set last_execution = p_execution_date
    where id = p_action_id;
END$$

CREATE DEFINER=`bthaens`@`%` PROCEDURE `swap_cage_content`(`cage1` INT, `cage2` INT)
BEGIN
	DECLARE l_id, l_cage, l_new_cage int;
    DECLARE l_eoc BOOL DEFAULT FALSE;

	DECLARE c_select CURSOR for
    SELECT id, cage
    FROM hospitalization
    WHERE cage = cage1 or cage = cage2;
    
    DECLARE c_execute CURSOR for
    SELECT *
    FROM swap_table;
    
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET l_eoc = true;
    
    OPEN c_select;
    FETCH c_select INTO l_id, l_cage;
    
    WHILE NOT l_eoc DO
		IF l_cage = cage1 THEN SET l_new_cage = cage2;
        ELSE SET l_new_cage = cage1;
        END IF;
        
        
		FETCH c_select INTO l_id, l_cage;
    END WHILE;
    CLOSE c_select;
    
    SET l_eoc = FALSE;
    OPEN c_execute;
    FETCH c_execute INTO l_id, l_cage;
    WHILE NOT l_eoc DO
		UPDATE hospitalization
        SET cage = l_cage
        WHERE id = l_id;
        
        DELETE FROM swap_table
        WHERE rcd_id = l_id;
        
        FETCH c_execute INTO l_id, l_cage;
    END WHILE;
    CLOSE c_execute;
        
END$$

